import { JsonApiMetaData } from '../utils/generics'
import { AnyResource } from './Resource'

export class ApiResult<T, M extends JsonApiMetaData<any>> {
  data: T
  meta: M

  constructor(data: T, meta: M) {
    this.data = data
    this.meta = meta
  }

  [Symbol.iterator](): IterableIterator<T extends Array<any> ? T[number] : T> {
    return Array.isArray(this.data)
      ? this.data[Symbol.iterator]()
      : [this.data][Symbol.iterator]()
  }
}

export class ApiGetResult<
  R extends AnyResource,
  M extends JsonApiMetaData<any>
> extends ApiResult<R, M> {
  constructor(data: R, meta: M) {
    super(data, meta)
  }
}
